<html>
    <head>
        <meta charset="utf-8">
        <meta name="viewport" content="width=device-width, initial-scale=1">
        <title>App</title>
        <link rel="icon" href="../assets/img/star.jpg">
        <style type="text/css">
            #lodd {
                align-items: center;
                background: white;
                display: block;
                position: absolute;
                width: 100%;
                height: 100vh;
                top: 0px;
                justify-content: center;
                visibility: visible;
                z-index: 1;
            }

            .loader_its {
                width: 100%;
                height: 100%;
                display: block;
                margin: auto;
                position: fixed;
                background: #FFF;
                box-sizing: border-box;
            }

            .loader_its::after {
                content: '';
                width: calc(100% - 30px);
                height: calc(100% - 15px);
                top: 15px;
                left: 15px;
                position: absolute;
                background-image: linear-gradient(90deg, transparent, rgba(255, 255, 255, 0.5) 50%, transparent 100%), linear-gradient(#DDD 100px, transparent 0), linear-gradient(#DDD 25px, transparent 0), linear-gradient(#DDD 66px, transparent 0), linear-gradient(#DDD 50px, transparent 0);
                background-repeat: no-repeat;
                background-size: 75px 100%, 100% 100px, 100% 25px, 100% 66px, 100% 50px;
                background-position: -185px 0, center 0, center 115px, center 152px, center 230px;
                box-sizing: border-box;
                animation: animloader 1s linear infinite;
            }

            @keyframes animloader {
                to {
                    background-position: 185px 0, center 0, center 115px, center 152px, center 230px;
                }
            }
        </style>
        <style type="text/css">
            @import url('https://fonts.googleapis.com/css2?family=Staatliches&display=swap'); /* General Styling */
            body {
                //font-size: 4rem;
                //text-align: center;
                color: #fff;
                background: black;
                margin: 0;
                padding: 0;
            }

            h1 {
                font-size: 2rem;
                margin-bottom: 2rem;
            }

            body {
            }

            #content {
                display: none;
            }

            .section {
                padding: 7px;
                overflow: auto;
                //height: 100vh;
                display: flex;
                padding-left: 10px;
            }

            .title h2 {
                margin-top: 20px;
                padding-left: 7px;
                margin-bottom: 0;
            }

            .title h2 i {
                float: right;
            }

            #banner {
                position: relative;
                background-size: cover;
                background-position: center;
                min-height: 250px;
            }

            #banner .container .logo {
                padding-top: 15%;
                width: 100%;
                text-align: center;
            }

            #banner .container .logo img {
                width: 120px;
            }

            #banner .container .opt {
                position: relative;
            }

            #banner .container .option {
                background: linear-gradient(0deg, rgba(0,0,0,0), #575757cc);
                //display: flex;
                position: absolute;
                //right: 0;
                color: white;
                width: 100%;
                //background: #5757577a;
                text-align: end;
            }

            #banner .container .option a {
                margin-right: 15px;
                color: white;
                font-size: 30px;
                font-weight: 700;
                transition: 0.3s;
            }

            #banner .container .option a:focus, #banner .container .option a:hover {
                color: #009bff;
                font-size: 3rem;
            }

            @media (min-width: 768px) {
                #banner {
                    min-height: 300px;
                }
            }

            @media (min-width: 992px) {
                #banner {
                    min-height: 400px;
                }
            }

            .h1_free {
                color: #01ff01;
            }
        </style>
        <style type="text/css">
            /* Estilo para el body de la página */
            body {
                color: #fff;
                background: black;
                margin: 0;
                padding: 0;
            }

            .container {
                display: flex;
                flex-wrap: wrap;
                justify-content: center;
                max-width: 1200px;
                margin: 20px auto;
                padding: 20px;
            }

            .card {
                background-color: #333;
                /* Fondo oscuro para las tarjetas */
                border-radius: 8px;
                box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
                margin: 20px;
                padding: 20px;
                text-align: center;
                transition: transform 0.3s ease;
                width: 250px;
                text-decoration: none;
            }

            .card:hover, .card:focus {
                transform: translateY(-10px);
                box-shadow: 0 12px 20px rgba(255, 255, 255, 0.2);
                /* Sombra blanca cuando se enfoca */
                background-color: #f0f0f0;
                border-color: #ff5733;
                /* Cambiar color del borde */
                color: #000;
                /* Color del texto negro */
            }

            .card:hover h2, .card:hover p, .card:focus h2, .card:focus p {
                color: #000;
                /* Color del texto negro en hover y focus */
            }

            .card img {
                width: 100%;
                height: auto;
                border-radius: 8px;
                margin-bottom: 10px;
            }

            .card h2 {
                margin: 0;
                color: #fff;
                /* Color del texto blanco */
            }

            .card p {
                color: #ccc;
                /* Color del texto gris claro */
            }

            .hora {
                color: #ff5733;
                /* Color naranja brillante */
                font-size: 1.2em;
                /* Tamaño de fuente un poco más grande */
                font-weight: bold;
                /* Texto en negrita */
                margin-top: 15px;
                /* Margen superior un poco más grande */
                text-transform: uppercase;
                /* Texto en mayúsculas */
            }
        </style>
    </head>
    <body>
        <div>
            <div id="banner">
                <div class="container p-0">
                    <div id="opt" class="opt"></div>
                    <div class="logo">
                        <img src="../assets/img/star.jpg">
                        <h1 style="margin-bottom: 0px;">STAR</h1>
                        <h1 class="h1_free">Solo Disponible para America</h1>
                    </div>
                </div>
            </div>
        </div>
        <div id="container" class="container"></div>
        <div id="lodd">
            <span class="loader_its"></span>
        </div>
    </body>
</html>
